led &amp;amp;ldquo;Minikraken,&amp;amp;rdquo; \nwhich includes annotations for a more limited set of organisms but is more comprehensive for those organisms.&amp;lt;/li&amp;gt;\n&amp;lt;/ul&amp;gt;"},"id":"1605","type":"panel.models.markup.HTML"},{"attributes":{},"id":"1617","type":"Selection"},{"attributes":{"indices":[]},"id":"1520","type":"Selection"},{"attributes":{"children":[{"id":"1597"},{"id":"1598"}],"margin":[0,0,0,0],"name":"Column00283","sizing_mode":"stretch_width"},"id":"1596","type":"Column"},{"attributes":{"child":{"id":"1602"},"name":"Column00293","title":"Information About Programs"},"id":"1611","type":"Panel"},{"attributes":{},"id":"1616","type":"UnionRenderers"},{"attributes":{"child":{"id":"1596"},"name":"Column00283","title":"Alignment Coverage"},"id":"1601","type":"Panel"},{"attributes":{"child":{"id":"1607"},"name":"MEGAHIT","title":"MEGAHIT"},"id":"1608","type":"Panel"},{"attributes":{"data":{"$schema":"https://vega.github.io/schema/vega-lite/v4.17.0.json","config":{"view":{"continuousHeight":300,"continuousWidth":400}},"data":{"name":"data-104ebfc18e15cccc29d515a08075abca"},"datasets":{},"encoding":{"color":{"field":"name","title":null,"type":"nominal"},"tooltip":[{"field":"domain","type":"nominal"},{"field":"new_est_reads","title":"Number of reads","type":"quantitative"}],"x":{"axis":{"format":".1%"},"field":"percent","title":"Percent of reads","type":"quantitative"},"y":{"field":"name","sort":"-x","title":null,"type":"nominal"}},"height":"container","mark":"bar","selection":{"selector017":{"bind":"scales","encodings":["x","y"],"type":"interval"}},"title":"Kraken classification raw","width":"container"},"data_sources":{"data-104ebfc18e15cccc29d515a08075abca":{"id":"1541"}},"events":["selector017"],"height":322,"margin":[5,5,30,5],"sizing_mode":"stretch_both","subscribed_events":["vega_event"],"throttle":{"selector017":20},"width":422},"id":"1542","type":"panel.models.vega.VegaPlot"}],"root_ids":["1506"]},"title":"Bokeh Application","versio
